import { useState, useEffect } from "react";

function useFetch(url) {
  const [data, setData] = useState([]);

  useEffect(() => {
    try {
      const fetchData = async () => {
        const response = await fetch(url);
        const data = await response.json();
        setData(data);
      };
    } catch (error) {
      console.log(error);
    }
    fetchData();
  }, [url]);

  return { data };
}

export default useFetch;
